import{_ as t,o as e,c as a,O as o}from"./chunks/framework.7d066bc9.js";const r="/assets/W020230213417387503080.f962fd4f.jpg",m=JSON.parse('{"title":"兰州化物所3D打印复合梯度结构聚酰亚胺研究获进展","description":"","frontmatter":{"title":"兰州化物所3D打印复合梯度结构聚酰亚胺研究获进展","hidden":false,"tag":["物理学","化学","其他"],"sticky":100,"top":1},"headers":[],"relativePath":"tag_news/202302_107.md","filePath":"tag_news/202302_107.md","lastUpdated":null}'),s={name:"tag_news/202302_107.md"},_=o('<h2 id="兰州化物所3d打印复合梯度结构聚酰亚胺研究获进展" tabindex="-1">兰州化物所3D打印复合梯度结构聚酰亚胺研究获进展 <a class="header-anchor" href="#兰州化物所3d打印复合梯度结构聚酰亚胺研究获进展" aria-label="Permalink to &quot;兰州化物所3D打印复合梯度结构聚酰亚胺研究获进展&quot;">​</a></h2><blockquote><p><strong>标签:</strong> [物理学] [化学] [其他]<br><strong>高频词:</strong> PI, 打印, ,  , 3D</p></blockquote><p>聚酰亚胺（PI）因优异的机械性能、热稳定性能及耐原子氧性能而被广泛用于自润滑材料。在PI的整个基体中加入纳米填料以改善其摩擦学性能已被研究。然而，由于成型方法的限制，PI的整体梯度结构较少被提及。增材制造又称3D打印，能够发挥自由制造复杂对象的优势，为PI的结构设计带来了机会。同时，满足高性能和高保形的3D打印PI对于摩擦学过程至关重要，但颇具挑战。</p><p>近日，中国科学院兰州化学物理研究所先进润滑与防护材料研发中心研究员王齐华、王廷梅带领的团队，报道了高强、高形状保持聚酰亚胺及其复合梯度结构的一体化打印用于增强摩擦学性能。科研人员从分子水平设计出发，结合分子动力学模拟计算得到了高溶解度/高性能的PI前驱体墨水，将甲基丙烯酸二甲氨基乙酯作为流变改性剂以及紫外光交联位点得到了适用于DIW打印的墨水。</p><p>研究显示，通过优化墨水配方，得到的3D打印PI具有突出的抗拉强度（~126 MPa）、优异的杨氏模量（~3.5 GPa）、高硬度（~380 MPa）、显著的热稳定性（Td~415°C、Tg~220°C）、低线性收缩率（~11%）以及优异的透光率和透明度。</p><p>研究人员进一步选用二硫化钼（MoS2）作为固体润滑剂，制备了PI/MoS2复合墨水，实现了不同结构PI的一体化打印。结果表明，3D打印的梯度PI/MoS2具有稳定/低的摩擦系数（COF）和极小的磨损，磨损率比3D打印的纯PI降低了68%。</p><p>相关研究成果发表在<em>Additive Manufacturing</em>上*。*研究工作得到国家自然科学基金、中科院战略性先导科技专项（B类）培育项目等的支持。</p><p><a href="https://doi.org/10.1016/j.addma.2023.103440" target="_blank" rel="noreferrer">论文链接</a></p><p><img src="'+r+'" alt=""></p><p>3D打印聚酰亚胺及其摩擦学性能</p>',10),n=[_];function p(d,c,i,l,P,f){return e(),a("div",null,n)}const I=t(s,[["render",p]]);export{m as __pageData,I as default};
